import HeaderPage from "../../components/HeaderPage/HeaderPage";
import { Header, Divider } from "semantic-ui-react";
import "./index.css";

function KnowMore({ location }) {
  return (
    <div className="know-more-container">
      <HeaderPage location={location}></HeaderPage>
      <div className="content-know-more">
        <Header>What I'm doing, and what I did</Header>
        <Divider></Divider>
        <p>
          Actualmente me encuentro aprendiendo múltiples tecnologías, como
          pueden ser: Redux, Semantic UI, etc. Tambien, estoy tratando de
          dominar los conceptos de la programacion funcional, y extrapolar estos
          (dentro de lo posible) al desarrollo Frontend con React, y al Backend.
        </p>
      </div>
    </div>
  );
}

export default KnowMore;
